import React, { useState } from "react";
import axios from "axios";
import { HeaderComp } from "../../../components/header/header.js";
import { FooterComp } from "../../../components/footer/footer.js";
import "./Login.scss";
//////////////////////////

export const Login = () => {
  const [Email, setEmail] = useState("");
  const [Password, setPassword] = useState("");
  let errorMasseges = document.getElementsByClassName("errorMassege");
  //////////
  const submit = async (e) => {
    e.preventDefault();
    let emailFormat = /^\w+([\\.-]?\w+)*@\w+([\\.-]?\w+)*(\.\w{2,3})+$/.test(
        Email
      ),
      passwordFormat =
        /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*[a-zA-Z]).{8,}$/.test(Password),
      passwordLenght = Boolean(
        (Password.length >= 8) & (Password.length <= 20)
      );
    let submitCond = emailFormat & passwordFormat & passwordLenght;
    try {
      if (submitCond) {
        // eslint-disable-next-line no-unused-vars
        let res = await axios
          .post("http://127.0.0.1:8000/api/login", {
            email: Email,
            password: Password,
          })
          .catch((reason) => {
            if (reason.response.status === 401) {
              errorMasseges[3].innerHTML = `password or email is not valid`;
            } else {
              errorMasseges[3].innerHTML = ``;
            }
          });
        if (res.status === 200) {
          window.localStorage.setItem("email", Email);
          window.location.pathname = "/";
        }
      } else {
        console.log("data errorr");
      }
    } catch (reason) {}
  };

  const handelEmail = (userEmail) => {
    setEmail(userEmail);
    let emailFormat = /^\w+([\\.-]?\w+)*@\w+([\\.-]?\w+)*(\.\w{2,3})+$/.test(
      userEmail
    );
    if (emailFormat || userEmail.length === 0) {
      errorMasseges[0].innerHTML = ``;
      // emailContainer.classList.add("valid");
      // emailContainer.classList.remove("notvalid");
    } else {
      errorMasseges[0].innerHTML = `*exam_3mple@gmail.com`;
      // emailContainer.classList.add("notvalid");
      // emailContainer.classList.remove("valid");
    }
  };

  const handelPassword = (userPassword) => {
    console.log(userPassword);
    setPassword(userPassword);
    let passwordLenght =
        (userPassword.length >= 8) & (userPassword.length <= 20),
      passwordFormat =
        /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*[a-zA-Z]).{8,}$/.test(
          userPassword
        );
    passwordLenght
      ? (errorMasseges[1].innerHTML = ``)
      : (errorMasseges[1].innerHTML = `*must mor than 7`);
    passwordFormat
      ? (errorMasseges[2].innerHTML = ``)
      : (errorMasseges[2].innerHTML = `*format error`);

    // if (passwordLenght & passwordFormat) {
    //   passwordContainer.classList.add("valid");
    //   passwordContainer.classList.remove("notvalid");
    // } else {
    //   passwordContainer.classList.add("notvalid");
    //   passwordContainer.classList.remove("valid");
    // }
  };

  return (
    <div id="LoginPerant">
      <HeaderComp />
      <section id="signUpSec" className="LoginSec">
        <div className="overLay">
          <div className="contentBox">
            <h1 className="contentHeading">create acounte!</h1>
            <p className="content">
              To keep contected with us please login with your personal info{" "}
            </p>
            <a href="#x" className="Btn">
              signup
            </a>
          </div>
        </div>
        <div className="formContainer">
          <form
            method=""
            action=""
            id=""
            className="LoginForm"
            onSubmit={submit}
          >
            <h1 className="formHeading">welcome back</h1>
            <div className="socialBox">
              <i className="fa-brands fa-facebook" />
              <i className="fa-brands fa-google" />
              <i className="fa-brands fa-github" />
            </div>
            <p className="notice">
              <a href="#x">forget your password?</a>
            </p>
            <div id="emailFieldBoxLog" className=" inputContainer">
              <input
                type="email"
                id="emailInput"
                vlue={Email}
                placeholder="email..."
                name="emailInput"
                onChange={(e) => {
                  handelEmail(e.target.value);
                }}
              />
              <p className="errorMassege" />
            </div>
            <div id="passwordFieldBoxLog" className=" inputContainer">
              <input
                type="password"
                id="passwordInput"
                vlue={Password}
                placeholder="password..."
                name="passwordInput"
                onChange={(e) => {
                  handelPassword(e.target.value);
                }}
              />
              <p className="errorMassege" />
              <p className="errorMassege" />
              <p className="errorMassege" />
            </div>
            <button type="submit" className="submitBtn">
              login
            </button>
          </form>
        </div>
      </section>
      <FooterComp />
    </div>
  );
};
